(()=>{let e=new class{constructor(e){this.el=e.el,this.arr=[]}parseHtml(){var e=this.el.match(/(#*|\S+)\s+\S*\n/g),r=0;return e.forEach((e=>{if(/#+/.test(e)){var t=`<h${r=++r>6?6:r}>${e.split(/\s+/)[1]}</h${r}>`;this.arr.push(t)}else{var s=`<p>${e.trim()}</p>`;this.arr.push(s)}})),this.arr.join("")}}({el:document.querySelector("template").content.querySelector("article").innerText}),r=e.parseHtml();document.querySelector(".box").innerHTML=r})();